message:
Aceitaremos a construção pelo STF para colocar o luladrão na presidência?

1) Prisão somente após a última instância (trânsito em julgado);

2) Soltura do ladrão;

3) Anulação da condenação do ladrão em três instância;

4) Tornar o ladrão elegível;

5) Por fim, a fraude: apuração eletrônica secreta dos votos que fere o princípio da publicidade do Art. 37 da CF.
